// Importing necessary React libraries and components
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // Root App component
import reportWebVitals from './reportWebVitals'; // Optional: For performance tracking

// Rendering the root component (App) inside the div with id 'root'
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root') // The div where the React app will be rendered
);

// This is an optional function to log web vitals to an analytics endpoint.
reportWebVitals();
